import styled from 'styled-components';

export const LanguageChoiceContainer = styled.div`
  width: 70%;
  display: flex;
  justify-content: space-between;
  align-items: center;

  button {
    padding: 5px 10px;
    border-radius: 8px;
    border: none;
    cursor: pointer;
  }

  button:focus {
    outline: 0;
    border: 3px white solid;
  }

  .pressed {
    box-shadow: inset 3px 3px 10px -4px rgba(0,0,0,0.75);
  }
`;
